package com.js.hc;

public class Values {

	private String a;
	private String b;
	
	public Values() {
		// TODO Auto-generated constructor stub
	}

	public Values(String a, String b) {
		super();
		this.a = a;
		this.b = b;
	}

	public String getA() {
		return a;
	}

	public void setA(String a) {
		this.a = a;
	}

	public String getB() {
		return b;
	}

	public void setB(String b) {
		this.b = b;
	}
	
}
